// React
import { useNavigate } from 'react-router-dom'

// Component
import Tab from '../../components/Tab'

// Style
import './style.scss'


function Header () {

  const navigate = useNavigate()

  function goTo(e, path) {
    e.preventDefault()
    navigate(path)
  }

  return (
    <header>
    <nav className="nav">
      <div className="nav_text">Amandine Cartier-Michaud</div>
      <div className="nav_tab-container">
          <Tab action={(e) => goTo(e, "/")} iconClass="icon fa-solid fa-house" text="Profile"/>
          <Tab action={(e) => goTo(e, "/projects")} iconClass="icon fa-solid fa-chalkboard" text="Projets"/>
          <Tab action={(e) => goTo(e, "/contact")} iconClass="icon fa fa-envelope" text="Contact"/>
      </div>
    </nav>
    </header>
  )
}

export default Header
